import React from "react";
import {Line} from "react-chartjs-2";
d3.csv('CleanData.csv')

const BarChart = () =>{
    return(
        <div>
            <Line

                data={{

                    datasets: [
                        {
                            backgroundColor: '#004d4d',

                            data: [2397.1675675766896,2371.333300191334,2573.025408191334,2573.948942191334,2574.872476191334,2574.410709191334,2703.937630191334,2804.9613141913337]
                        }]
                }}
                height={400}
                width={900}
                options={{
                    maintainAspectRatio: false,
                }
                }


            />
        </div>
    )
}

export default BarChart
